import React from "react";
import { Container, Row, Col, Card, Button } from "react-bootstrap";
import { FaHospital, FaShoppingCart, FaHotel, FaBuilding, FaFilm, FaShieldAlt } from "react-icons/fa";
import "../styles/Projects.css";
import proj1 from "../assets/mgm_hospital.webp";
import proj2 from "../assets/prozone_mall.webp";
import proj3 from "../assets/lemon_tree.webp";
import proj4 from "../assets/brahma_suncity.webp";
import proj5 from "../assets/pvr_nashik.webp";
import proj6 from "../assets/drdo.webp";

function Projects() {
  const projects = [
    {
      icon: <FaHospital />,
      image: proj1,
      title: "MGM Hospital, Chhatrapati Sambhajinagar",
      description: "Full-scale fire hydrant and sprinkler system installation to ensure top-tier fire safety for this critical medical facility.",
    },
    {
      icon: <FaShoppingCart />,
      image: proj2,
      title: "Prozone Mall, Chhatrapati Sambhajinagar",
      description: "Advanced fire suppression and alarm systems installed for the region’s largest commercial mall, ensuring safety for all visitors.",
    },
    {
      icon: <FaHotel />,
      image: proj3,
      title: "Lemon Tree Hotel, Pune",
      description: "Comprehensive fire alarm systems and hydrant pumps implemented, meeting strict hotel safety regulations for guest protection.",
    },
    {
      icon: <FaBuilding />,
      image: proj4,
      title: "Brahma Sun City, Pune",
      description: "Installed fire extinguishers, hose reels, and alarms for a high-rise residential complex, ensuring resident safety.",
    },
    {
      icon: <FaFilm />,
      image: proj5,
      title: "PVR Multiplex, Nashik",
      description: "Complete fire safety solutions with smoke detectors, sprinklers, and emergency exit compliance for a premier entertainment venue.",
    },
    {
      icon: <FaShieldAlt />,
      image: proj6,
      title: "DRDO, Ministry of Defense",
      description: "Supplied fire-fighting crew and hydrant systems for a government defense research facility, ensuring top security standards.",
    },
  ];

  return (
    <div className="projects-page">
      {/* Hero Section */}
      <div className="projects-hero-section">
        <div className="hero-overlay">
          <Container className="hero-content">
            <h1>Showcasing Our Fire Safety Excellence</h1>
            <p>Trusted Solutions for Leading Industries and Institutions.</p>
            <Button variant="danger" href="/contact" className="hero-button">
              Explore Our Work
            </Button>
          </Container>
        </div>
      </div>

      {/* Projects Section */}
      <Container fluid className="projects-content-section">
        <Container>
          <h2 className="text-center mb-5">Our Landmark Projects</h2>
          <Row>
            {projects.map((project, index) => (
              <Col md={4} className="mb-4" key={index}>
                <Card className="project-card">
                  <div className="project-image-wrapper">
                    <img src={project.image} alt={project.title} className="project-image" />
                  </div>
                  <Card.Body>
                    <div className="project-icon">{project.icon}</div>
                    <Card.Title>{project.title}</Card.Title>
                    <Card.Text>{project.description}</Card.Text>
                  </Card.Body>
                </Card>
              </Col>
            ))}
          </Row>
        </Container>
      </Container>
    </div>
  );
}

export default Projects;
